criteria:
Inclusion Criteria:

  1. Patients with histologically confirmed small cell lung cancer which is persistent and
     metastatic or recurrent and metastatic;

  2. Patients must have at least 3 distinct measurable metastatic sites at least 1 cm of
     larger in their largest diameter;

  3. Age ≥18 years;

  4. Metastatic disease measurable on a CT/MRI scan. The primary tumor is not considered
     measurable disease. Metastatic lesions within a prior radiation field are acceptable
     as long as disease has progressed in the radiation field by RECIST criteria. The same
     imaging modality performed at baseline (CT or MRI) will be repeated at subsequent
     imaging.

  5. ECOG performance status: 0-1;

  6. Life expectancy ≥ 3 months.

  7. Patients have adequate baseline organ and marrow function as defined by an absolute
     neutrophil count greater than 1500 cells per μL, platelet concentration of greater
     than 50 000 per μL, total bilirubin less than 1•5 times the upper limit of normal
     (ULN), aspartate aminotransferase and alanine aminotransferase less than 2•5 times the
     ULN, and serum creatinine less than 1•5 times the ULN;

  8. Signed consent forms voluntarily;

Exclusion Criteria:

  1. Patients undergoing therapy with other investigational agents.

  2. Women who are pregnant or breastfeeding;

  3. Patients with known brain metastases can be included in this clinical trial but brain
     lesions are not eligible as target or non target lesion;

  4. Active severe infection or known chronic infection with HIV, hepatitis B virus, or
     hepatitis C virus;

  5. Cardiovascular disease problems including unstable angina, therapy for
     life-threatening ventricular arrhythmia, myocardial infarction, stroke or congestive
     heart failure within the last 6 months;

  6. The subject has had another active malignancy within the past five years except for
     cervical cancer in site, in situ carcinoma of the bladder or non-melanoma carcinoma of
     the skin;

  7. Clinically significant and uncontrolled major medical conditions including but not
     limited to: active uncontrolled infection, symptomatic congestive heart failure,
     Unstable angina pectoris or cardiac arrhythmia, psychiatric illness/ social situation
     that would limit compliance with study requirements; any medical condition, which in
     the opinion of the study investigator places the subject at an unacceptably high risk
     for toxicities;

  8. Patients with any other concurrent disease which, in the judgment of the investigator,
     would make the patient inappropriate for participation in the study.

Inclusion Criteria:

  1. Patients with histologically confirmed colorectal cancer which is persistent and
     metastatic or recurrent and metastatic;

  2. Patients must have at least 3 distinct measurable metastatic sites at least 1 cm of
     larger in their largest diameter;

  3. Age ≥18 years;

  4. Metastatic disease measurable on a CT/MRI scan. The primary tumor is not considered
     measurable disease. Metastatic lesions within a prior radiation field are acceptable
     as long as disease has progressed in the radiation field by RECIST criteria. The same
     imaging modality performed at baseline (CT or MRI) will be repeated at subsequent
     imaging.

  5. ECOG performance status: 0-1;

  6. Life expectancy ≥ 3 months.

  7. Patients have adequate baseline organ and marrow function as defined by an absolute
     neutrophil count greater than 1500 cells per μL, platelet concentration of greater
     than 50 000 per μL, total bilirubin less than 1•5 times the upper limit of normal
     (ULN), aspartate aminotransferase and alanine aminotransferase less than 2•5 times the
     ULN, and serum creatinine less than 1•5 times the ULN;

  8. Signed consent forms voluntarily;

Exclusion Criteria:

  1. Patients who have had prior allergic reaction to Apatinib;

  2. Patients undergoing therapy with other investigational agents.

  3. Women who are pregnant or breastfeeding;

  4. Patients with known brain metastases can be included in this clinical trial but brain
     lesions are not eligible as target or non target lesion;

  5. Anticipated patient survival under 3 months;

  6. Active severe infection or known chronic infection with HIV, hepatitis B virus, or
     hepatitis C virus;

  7. Cardiovascular disease problems including unstable angina, therapy for
     life-threatening ventricular arrhythmia, myocardial infarction, stroke or congestive
     heart failure within the last 6 months;

  8. The subject has had another active malignancy within the past five years except for
     cervical cancer in site, in situ carcinoma of the bladder or non-melanoma carcinoma of
     the skin;

  9. Clinically significant and uncontrolled major medical conditions including but not
     limited to: active uncontrolled infection, symptomatic congestive heart failure,
     Unstable angina pectoris or cardiac arrhythmia, psychiatric illness/ social situation
     that would limit compliance with study requirements; any medical condition, which in
     the opinion of the study investigator places the subject at an unacceptably high risk
     for toxicities;

 10. Patients with any other concurrent disease which, in the judgment of the investigator,
     would make the patient inappropriate for participation in the study.

Inclusion Criteria:

  -  Male or female subjects with age ≥ 18 years or the otherwise legal lower age according
     to the country of residence;

  -  Confirmed acute lower extremity proximal DVT or PE for which long term treatment with
     low molecular weight heparin (LMWH) is indicated;

  -  Cancer, other than basal-cell or squamous-cell carcinoma of the skin;

  -  Able to provide written informed consent.

Exclusion Criteria:

  -  Thrombectomy, insertion of a caval filter, or use of a fibrinolytic agent to treat the
     current (index) episode of DVT and/or PE;

  -  Treatment with therapeutic doses of an anticoagulant other than that used for
     pretreatment of the current (index) VTE episode prior to randomization;

  -  Active bleeding or high risk for bleeding contraindicating treatment with LMWH or
     edoxaban;

  -  Any other contraindication listed in the local labeling of dalteparin, enoxaparin, or
     edoxaban;

Inclusion Criteria:

  -  Female, aged ≥ 18 years old;

  -  Eastern Cooperative Oncology Group performance status (ECOG -PS) ≤ 1;

  -  Locally advanced or metastatic triple-negative breast cancer, i.e. HER2-negative
     status and ER and PgR negative status (as per local assessment);

  -  Treatment with 1st line chemotherapy (with any drug excepted Bevacizumab-based
     regimens) as per clinical practice, and non-progressive when the treatment was
     terminated;

  -  No more than 6 cycles of the previous chemotherapy;

  -  At least one measurable lesion according to Response Evaluation Criteria in Solid
     Tumors (RECIST, version 1.1);

  -  Willingness and ability to comply with the study protocol as judged by the
     Investigator;

  -  For women who are not postmenopausal (i.e., < 2 years after last menstruation) and who
     are sexually active: agreement to use an adequate method of contraception (oral
     contraceptives, intrauterine contraceptive device, barrier method of contraception in
     conjunction with spermicidal jelly) during the treatment period and for at least 6
     months after the last dose of study drug;

  -  Provision of a written informed consent signed prior to enrolment according to
     ICH/GCP.

Exclusion Criteria:

  -  Previous treatment with vinorelbine or capecitabine;

  -  1st line therapy with a bevacizumab-based regimen;

  -  Presence of brain metastases;

  -  Any other investigational drug or any anti-cancer treatment (except for radiotherapy,
     if the treatment field does not include the liver);

  -  Inadequate bone marrow, hepatic or renal function including the following:

       1. absolute neutrophils count of < 1.5 cells x 109/L, platelet count < 100 cells x
          109/L, or hemoglobin < 8 g/L;

       2. serum total bilirubin >1.5 × institution upper limit of normal [ULN], aspartate
          aminotransferase and alanine aminotransferase >2.5 × ULN, or >5 × ULN for
          patients with liver metastases, alkaline phosphatase >2.5 × ULN, or >5 × ULN for
          patients with liver metastases, or >10 × ULN for patients with bone metastases;

       3. serum creatinine concentration >1.5 × ULN, creatinine clearance <50 mL/min
          calculated according to Cockcroft-Gault equation, and coagulation parameters
          international normalized ratio >1.5;

  -  With the exception of basal cell carcinoma or cervical cancer in situ, history of
     another malignancy, unless in remission for 5 years or more and judged of negligible
     potential of relapse;

  -  Known dihydropyrimidine dehydrogenase deficiency;

  -  Treatment with sorivudine or its chemically related analogues, such as brivudine,
     within 4 weeks prior to randomization;

  -  Evidence of any significant clinical disorder or concurrent illness or laboratory
     finding that, at the judgment of the Investigator, contra-indicate the inclusion of
     the patient in the study;

  -  Psychiatric disorders or altered mental status precluding understanding of the
     informed consent process and/or completion of the necessary study assessment and
     procedures;

  -  Unable to swallow tablets;

  -  Previous significant surgical resection of stomach or small bowel

  -  Patients requiring long-term oxygen therapy

  -  Known hypersensitivity to any excipients of oral vinorelbine, oral capecitabine and to
     fluoropyrimidine.

Inclusion Criteria:

  1. >/= 18 years of age;

  2. Diagnosis of primary myelofibrosis (PMF) or post-polycythemia vera (post-PV) MF or
     post-essential thrombocythemia (post-ET) MF based on the World Health Organization
     (WHO) criteria or the International Working Group-Myeloproliferative Neoplasms
     Research and Treatment (IWG-MRT) criteria, which must be confirmed by BM aspirate
     and/or biopsy within 6 weeks prior to Screening. Measurement of JAK2 V617F allele
     burden in Bone Marrow (BM) samples, if not done within 6 months prior to Screening,
     must be provided with the Screening BM biopsy/aspirate report (patients are eligible
     regardless of JAK2 mutation status);

  3. Anemia or RBC-transfusion dependence defined as follows: a) Anemia: defined for the
     purpose of this protocol as 1) a hemoglobin level <10 g/L on every determination over
     84 days before study-entry, without red blood cell (RBC)-transfusions, or 2) a
     hemoglobin level <10 g/L on a patient that is receiving RBC-transfusions periodically
     but not meeting criteria for transfusion-dependent patient as defined below. The
     baseline hemoglobin value for these subjects is the lowest hemoglobin level during the
     antecedent 84 days; b) RBC-transfusion-dependence: RBC-transfusion-frequency of >/=2
     units packed red blood cells (PRBC)/28 days averaged over 84 days immediately
     pre-study-entry. There must not be any consecutive 42 days without an RBC-transfusion
     during this interval.

  4. Eastern Cooperative Oncology Group (ECOG) performance status of 0, 1 or 2;

  5. Willing to adhere to the prohibitions and restrictions specified in this protocol
     (Notation: the subject's willingness to adhere to prohibitions and restrictions must
     be clearly communicated in the on-study note);

  6. The patient must signed an informed consent form (ICF) indicating that s/he
     understands the purpose of, and procedures required for, the study and is willing to
     participate.

Exclusion Criteria:

  1. Ongoing clinically significant anemia due to factors such as known iron, vitamin B12,
     or folate deficiencies, auto-immune or hereditary hemolysis, or gastrointestinal (GI)
     bleeding;

  2. Serum ferritin < 50 ng/mL;

  3. Any active malignancy within the past year, except basal cell or squamous cell skin
     cancer or carcinoma in situ of the cervix or breast; patients with history of prior
     malignancies should be free of disease for at least 3 years to be eligible for this
     study.

  4. Uncontrolled intercurrent illness, including, but not limited to symptomatic
     congestive heart failure, unstable angina pectoris, or cardiac arrhythmia;

  5. Active infection not adequately responding to appropriate therapy;

  6. Direct bilirubin >/= 2.0 mg/dL not related to hemolysis or Gilbert's disease;

  7. Alanine transaminase (ALT) or aspartate transaminase (AST)>/= 2.5 x the upper limit of
     normal (ULN);

  8. Serum creatinine >/= 2.5 mg/dL;

  9. Ascites requiring active medical management including paracentesis;

 10. Hyponatremia (defined as serum sodium level < 130 mEq/L);

 11. Female patients who are pregnant or lactating;

 12. Patients of childbearing potential (ie, women of childbearing potential and men with
     female partners of childbearing potential) who are unwilling to follow strict
     contraception requirements (including 2 reliable methods in combination: 1
     non-hormonal, highly-reliable method [diaphragm, condoms with spermicidal foam or
     jelly, or sterilization] plus 1 additional reliable method [birth control pills,
     intrauterine device, contraceptive injections, or contraceptive patches]) before entry
     and throughout the study, up to and including the 30-day non-treatment follow-up
     period;

 13. Female patients of childbearing potential who have a positive blood or urine pregnancy
     test at Screening;

 14. Major surgery without full recovery or major surgery within 3 weeks of Screening;

 15. Uncontrolled hypertension (defined as a sustained systolic pressure >/= 160 mmHg
     and/or a diastolic pressure >/= 110 mmHg);

 16. New onset seizures (within 3 months prior to Screening) or poorly controlled seizures;

 17. Any other concurrent investigational agent or chemotherapy, radiotherapy, or
     immunotherapy;

 18. Chronic use (> 2 weeks) of corticosteroids (prednisone >/= 10 mg/24 hr equivalent)
     within 4 weeks of Screening;

 19. Investigational therapy within 2 weeks of Screening;

 20. Psychiatric illness or social situation that would limit the patient's ability to
     tolerate and/or comply with study requirements.

Inclusion Criteria:

• Patients aged 65 to < 75 years with at least one non severe comorbidity ie disease or
syndrome with mild to moderate clinical or diagnostic observations or lab abnormalities
which could increase the risk of toxicity and/or early death of intensive chemotherapy in
the opinion of the investigator and are not contra-indicated for non-intensive
chemotherapy.

or ≥ 75 years with or without any comorbidity at the time of the informed consent
signature;

• Newly diagnosed, untreated de novo or secondary AML according to WHO classification;

Exclusion Criteria:

  -  Prior or current treatment with chemotherapy for any myeloid disorder (excluding
     hydroxyurea) or radiotherapy for extramedullary involvement within 2 weeks of
     randomization;

  -  Prior treatment with decitabine, azacitidine, or cytarabine;

  -  Prior malignancies for 5 years with exception of basal cell, squamous cell carcinoma
     of the skin, or carcinoma " in situ " of the cervix or breast;

  -  Chronic myelogenous or acute promyelocytic leukaemia;

  -  Known CNS involvement;

  -  Patient eligible to bone marrow or stem cell transplant;

  -  WBC ≥ 30.000/mm3;

  -  Impaired renal function with Creatinine clearance < 30 mL/min/1.73m² according to the
     MDRD formula;

  -  Serum bilirubin ≥ 2.5 x ULN and/or AST and/or ALT ≥ 2.5 x ULN (upper limit of normal
     value);

  -  Calcemia ≥ 2.65 mmol/L (106 mg/L) at screening assessment (corrected with
     albuminemia);

  -  History of diseases known to be associated with calcium disorders: ongoing
     hyperparathyroidism, sarcoidosis….;

  -  Presence or history of symptomatic kidney stones in the last 5 years;

  -  Hypersensitivity to any of the excipients of decitabine (Potassium dihydrogen
     phosphate (E340) ; Sodium hydroxide (E524) ; Hydrochloric acid (for pH adjustment) or
     to the excipient of inecalcitol tablets (lactose);

  -  Current use of drugs known to influence serum calcium (such as thiazide diuretics,
     teriparatide, calcitonin and multivitamin supplements containing > 400 IU of vitamin D
     or calcium);

  -  Current use of digitalis;

  -  Current use of drugs which could influence bioavailability of inecalcitol (such as
     magnesium-containing antacids, bile-resin binders);

  -  Use of any other experimental drug or therapy or vitamin D supplementation within 4
     weeks of randomization;

  -  Known HIV;

  -  Patients who are eligible for intensive induction therapy with curative intent;

  -  Refractory congestive heart failure;

  -  Active infection resistant to anti-infective therapy;

  -  Documented pulmonary disease with DLCO ≤ 65% or FEV1≤ 65%, or dyspnea at rest or
     requiring oxygen, or any pleural neoplasm or uncontrolled lung neoplasm;

  -  Liver cirrhosis Child B or C or acute viral hepatitis;

  -  Current mental illness requiring psychiatric hospitalization, institutionalization or
     intensive outpatient management, or current cognitive status that produces dependence
     (as confirmed by the specialist) not controlled by the caregiver;

  -  Uncontrolled neoplasia;

Inclusion Criteria:

  1. Subjects must be at least 18 years of age;

  2. Subjects must be post-allogeneic transplant from any donor source;

  3. Subjects must have either:

       1. High risk CD34+ AML (de novo or secondary, and any WHO 2008 classification
          excluding acute promyelocytic leukemia). High risk AML is defined as (a) disease
          status beyond complete remission (CR) #1 at transplant or (b) treatment related
          AML or (c) presence of adverse cytogenetics including inv(3); t(3;3); t(6;9);
          t(v;11); -5 or del(5q); -7; abnl(17p) or complex karyotype; or

       2. High risk CD34+ MDS (WHO 2008 classification). High risk is defined as (a) blast
          count ≥5% at the time of transplant or (b) treatment related MD or (c) presence
          of adverse cytogenetics including -7/del7q or complex karyotype;

  4. For AML subjects, they must have a documented CR within 45 days prior to allo-HCT;

  5. For MDS subjects, they must have < 20% myeloblasts in the bone marrow within 45 days
     prior to allo-HCT;

  6. Subject Karnofsky performance status must be ≥ 70;

  7. Subjects must be platelet transfusion independent (Platelet transfusion independence
     is defined as 7 days or greater without a platelet transfusion);

  8. Neutrophil count ≥ 1.0 thou/mm3 and platelet count ≥ 30 thou/mm3;

  9. Subjects must have total bilirubin ≤ 2 mg/dL;

 10. Subjects must have serum AST and ALT levels ≤ 2.5 times upper limit of normal;

 11. Subjects must have serum creatinine < 2.5 times upper limit of normal and a calculated
     creatinine clearance > 30 ml/min by Cockcroft-Gault formula (see Appendix I:
     Cockcroft-Gault Creatinine Clearance Calculation);

 12. All study participants who will receive lenalidomide based on the CD34+ chimerism
     testing must be registered into the mandatory Revlimid REMS® program, and be willing
     and able to comply with the requirements of the REMS® program;

 13. Females of child-bearing potential (i.e., women who are premenopausal or not
     surgically sterile) may participate, provided they meet the following conditions:

     a) Females of reproductive potential must adhere to the scheduled pregnancy testing as
     required in the Revlimid REMS® program; and

 14. Written, voluntary informed consent, willingness, and ability to comply with all study
     procedures.

Exclusion Criteria:

  1. CD34- AML or MDS;

  2. Inability to give informed consent;

  3. Uncontrolled active infection(s) requiring intravenous antibiotics;

  4. Known or suspected hypersensitivity to lenalidomide;

  5. Grade II-IV acute GVHD or extensive GVHD;

  6. Not able to swallow the lenalidomide capsule as a whole;

  7. Female subjects who are pregnant or nursing.

Inclusion Criteria:

  1. Patients with histologically confirmed colorectal cancer which is persistent and
     metastatic or recurrent and metastatic;

  2. Patients must have at least 3 distinct measurable metastatic sites at least 1 cm of
     larger in their largest diameter;

  3. Age ≥18 years;

  4. Metastatic disease measurable on a CT/MRI scan. The primary tumor is not considered
     measurable disease. Metastatic lesions within a prior radiation field are acceptable
     as long as disease has progressed in the radiation field by RECIST criteria. The same
     imaging modality performed at baseline (CT or MRI) will be repeated at subsequent
     imaging.

  5. ECOG performance status: 0-1;

  6. Life expectancy ≥ 3 months.

  7. Patients have adequate baseline organ and marrow function as defined by an absolute
     neutrophil count greater than 1500 cells per μL, platelet concentration of greater
     than 50 000 per μL, total bilirubin less than 1•5 times the upper limit of normal
     (ULN), aspartate aminotransferase and alanine aminotransferase less than 2•5 times the
     ULN, and serum creatinine less than 1•5 times the ULN;

  8. Signed consent forms voluntarily;

Exclusion Criteria:

  1. Patients who have had prior allergic reaction to Apatinib;

  2. Patients undergoing therapy with other investigational agents.

  3. Women who are pregnant or breastfeeding;

  4. Patients with known brain metastases can be included in this clinical trial but brain
     lesions are not eligible as target or non target lesion;

  5. Anticipated patient survival under 3 months;

  6. Active severe infection or known chronic infection with HIV, hepatitis B virus, or
     hepatitis C virus;

  7. Cardiovascular disease problems including unstable angina, therapy for
     life-threatening ventricular arrhythmia, myocardial infarction, stroke or congestive
     heart failure within the last 6 months;

  8. The subject has had another active malignancy within the past five years except for
     cervical cancer in site, in situ carcinoma of the bladder or non-melanoma carcinoma of
     the skin;

  9. Clinically significant and uncontrolled major medical conditions including but not
     limited to: active uncontrolled infection, symptomatic congestive heart failure,
     Unstable angina pectoris or cardiac arrhythmia, psychiatric illness/ social situation
     that would limit compliance with study requirements; any medical condition, which in
     the opinion of the study investigator places the subject at an unacceptably high risk
     for toxicities;

 10. Patients with any other concurrent disease which, in the judgment of the investigator,
     would make the patient inappropriate for participation in the study.

Inclusion Criteria:

  -  18 years or older;

  -  biopsy proven poorly differentiated carcinoma or adenocarcinoma of the rectum;

  -  lesions located within 12 cm of the anal verge (from colonoscopy assessment);

  -  ability to tolerate oral treatment;

  -  locally advanced tumor, classified by the presence of positive regional lymph nodes or
     primary tumor invasion beyond the serosa (T3 or T4), assessed by MRI;

  -  eligibility for curative surgery (no distant metastasis or invasion of bony structures
     of the pelvis);

  -  Performance Status (PS) Eastern Cooperative Oncology Group (ECOG) 0-2;

  -  adequate hematologic functions (hemoglobin ≥ 10 g / dL [5.6 mmol / L]; neutrophil
     count ≥ 1,500 / mm3 and platelet count ≥ 100,000 / mm3), adequate renal function
     (serum creatinine less than 1.5 times the UNL) and adequate hepatic function
     (bilirubin less than 1.5 times the UNL; aspartate aminotransferase and alanine
     aminotransferase less than 2.5 times the UNL);

Exclusion Criteria:

  -  known hypersensitivity to metformin or its excipients;

  -  squamous carcinomas of the rectum or anal canal;

  -  chronic treatment with corticosteroids or other immunosuppressive agents;

  -  treatment with oral antidiabetic products;

  -  distant metastasis at diagnosis or tumor invasion of pelvic bone structures that may
     proscribe curative intent surgery;

  -  chronic or acute infections;

  -  use of drugs under study up to four weeks prior to randomization;

  -  pregnant or nursing patients;

  -  prior radiotherapy to the pelvic region;

  -  myocardial infarction up to six months prior to randomization, or uncontrolled
     ischemic heart disease;

  -  congestive heart insufficiency New York Heart Association (NYHA) III-IV.

Inclusion Criteria:

  -  Affiliated to a social security regimen ;

  -  Male patients older than 18 years ;

  -  Histologically confirmed adenocarcinoma of the prostate ;

  -  Continued androgen deprivation therapy either by LHRH agonists/antagonists or
     orchidectomy ;

  -  Serum testosterone <0.50 ng/ml (1.7 nmol/L) ;

  -  Progressive disease (PSA progression or radiological progression or clinical
     progression) ;

  -  ECOG 0-2 ;

  -  Information delivered to patient and informed consent form signed by the patient or
     his legal representative ;

  -  Adequate organ or bone marrow function as evidenced by:

       -  Hemoglobin >/= 10 g/dL

       -  Absolute neutrophil count >/=1.5 x 109/L,

       -  Platelet count >/=100 x 109/L,

       -  AST/SGOT and/or ALT/SGPT </=1.5 x ULN;

       -  Total bilirubin </=1.5 x ULN,

       -  Serum creatinine </=1.5 x ULN. If creatinine 1.0 - 1.5 xULN, creatinine clearance
          will be calculated according to CKD-EPI formula and patients with creatinine
          clearance <60 mL/min should be excluded

Exclusion Criteria:

  -  Patients having received an investigational drug and/or prior surgery, radiation,
     chemotherapy, or other anti-cancer therapy within 4 weeks prior enrolment in the
     study, excepted radiotherapy directed to a single bone lesions which is nonacceptable
     if within 2 weeks ;

  -  Prior treatment with Taxotere or Jevtana ;

  -  Pre-existing symptomatic peripheral neuropathy grade > 2 (CTCAE V4) ;

  -  Uncontrolled cardiac arrhythmias, angina pectoris, and/or hypertension. History of
     congestive heart failure (NYHA III or IV) or myocardial infarction within last 6
     months is also not allowed ;

  -  History of severe hypersensitivity reaction (grade ≥3) to polysorbate 80 containing
     drugs ;

  -  Uncontrolled severe illness or medical condition (including uncontrolled diabetes
     mellitus), active infection including HIV infection, active Hepatitis B or C infection
     that would preclude participation in the trial ;

  -  Concurrent or planned treatment with strong inhibitors or strong inducers of
     cytochrome P450 3A4/5 (a one week wash-out period is necessary for patients who are
     already on these treatments) ;

Inclusion Criteria:

  -  Subjects aged ≥ 18 yrs and ≤ 65 yrs;

  -  Clinical diagnosis of one of the following hematological malignancies:

       -  Leukemia

       -  Myelodysplastic Syndromes

       -  Lymphomas

       -  Multiple Myeloma

       -  Other high-risk hematological malignancy eligible for stem cell transplantation
          per institutional standard;

  -  Recurrent disease that presents ≥100 days after, or minimal residual disease (MRD)
     that presents ≥ 30 days following a hematopoietic stem cell transplant (HSCT) using a
     matched unrelated donor located through the National Marrow Donor Program (NMDP);

  -  Life expectancy >10 weeks;

  -  Signed donor and patient/guardian informed consent;

  -  A 8/8 genotypic identical match as determined by high resolution typing for the
     following genetic loci: human leukocyte antigen (HLA)-A, HLA-B, HLA-C and HLA-DRB1;

  -  Performance status: Karnofsky score > 50%;

  -  Subjects with adequate organ function as measured by:

       -  Bone marrow:

            -  > 25% donor T-cell chimerism post-transplant

            -  Absolute neutrophil count (ANC) >1 x 109/L

       -  Cardiac: left ventricular ejection fraction (LVEF) at rest ≥ 45%

       -  Pulmonary: forced expiratory volume (FEV) 1, forced vital capacity (FVC),
          diffusion capacity of lunch for carbon monoxide (DLCO) ≥ 50% predicted (corrected
          for hemoglobin)

       -  Hepatic: direct bilirubin ≤ 3x upper limit of normal (ULN), or aspartate
          aminotransferase (AST)/alanine aminotransferase (ALT) ≤ 5x ULN

       -  Renal: creatinine ≤ 2x of ULN for age.

Exclusion Criteria:

  -  ≥ Grade II acute GVHD or chronic extensive GVHD due to a previous allograft at the
     time of screening;

  -  Active central nervous system (CNS) involvement with malignant cells (≤ 2 months prior
     to consenting);

  -  Current uncontrolled bacterial, viral or fungal infection (currently taking medication
     with evidence of progression of clinical symptoms or radiologic findings); the
     principal investigator is the final arbiter of this criterion;

  -  Positive HIV serology or viral RNA;

  -  Pregnancy (positive serum β human chorionic gonadotropin [HCG] test) or
     breast-feeding;

  -  Fertile men or women unwilling to use effective forms of birth control or abstinence
     for one year after transplantation;

  -  Bovine product allergy.

Inclusion Criteria:

  1. 18 ~ 75 years old, postmenopausal women;

  2. Histological or cytological confirmation of hormone receptor-positive [estrogen
     receptor (ER) positive and progesterone receptors (PgR) positive or negative] breast
     cancer;

  3. Disease progression or recurrence after at least one endocrine therapy (either in
     advanced/metastatic setting or adjuvant setting);

  4. ≤4 prior therapies (either in advanced/metastatic setting or adjuvant setting),
     patients may have received one prior chemotherapy;

  5. The disease condition is inoperable, stage III or stage IV, at least one measurable
     lesion or simple bone metastases with no measurable lesions;

  6. Last prior therapy intervals: (a) if the last treatment was endocrine therapy, the
     interval must ≥ 2 weeks; (b) if the last treatment was chemotherapy therapy, the
     interval must ≥ 4 weeks;

  7. Eastern Cooperative Oncology Group Performance Status: 0~1;

  8. Absolute neutrophil count ≥ 1.5×109 / L, platelet count ≥ 100×109 / L, hemoglobin ≥ 90
     g/L;

  9. Life expectancy ≥ 3 months;

 10. Have signed informed consent.

Exclusion Criteria:

  1. Patients have known central nervous system (CNS) metastases or a history of CNS
     metastases , or with leptomeningeal disease;

  2. Patients with human epidermal growth factor receptor-2 (Her-2) positive;

  3. Patients previously received treatment with exemestane;

  4. Patients received radiotherapy ≤ 4 weeks prior to study entry;

  5. Patients with no measurable lesion (except simple bone metastasis), such as pleural or
     pericardial effusion, ascites, et al;

  6. Patients have uncontrolled or significant cardiovascular disease, including:

       1. Myocardial infarction (< the last 12 months)

       2. Uncontrolled angina (< the last 6 months)

       3. Congestive heart failure (< the last 6 months), or Left Ventricular Ejection
          Fraction (LVEF) < 50% prior to study entry

       4. History of any significant ventricular arrhythmias (e.g., ventricular
          tachycardia, ventricular fibrillation, or TdP)

       5. History of significant QT interval prolongation, or Corrected QT Interval (QTc) >
          450 ms prior to study entry

       6. History of cerebrovascular accident

       7. Symptomatic coronary heart disease requiring treatment with agents

  7. The size of fluid area detected by cardiac ultrasonography in cavum pericardium is
     ≥10mm during diastolic period;

  8. History of organ transplantation;

  9. Patients have not recovered from all clinically relevant toxicities to grade 1 due to
     prior therapies;

 10. Patients have clinical significant gastrointestinal abnormality, e.g., unable to
     swallow, chronic diarrhea, ileus, that would interfere the ingestion,transportation or
     absorption of oral agents;

 11. Active infection [Suffered from active infection of bacteria, virus, fungi,
     mycobacteria, parasites, or other infections (excluding nail bed fungal infections),
     or require intravenous antibiotic therapy, or antiviral therapy, or hospitalization
     due to any significant infection events], or persistent fever within 14 days prior to
     study entry;

 12. Patients had organ surgery < 6 weeks prior to study entry;

 13. Abnormal liver function [total bilirubin > 1.5×upper limit of normal (> 3×upper limit
     of normal in case of Gilbert syndrome); Transaminases (ALT, AST) >2.5×upper limit of
     normal (>5x upper limit of normal patients with liver metastases), abnormal renal
     function (serum creatinine > 1.5×upper limit of normal);

 14. Patients with prior invasive malignancies with the exception of curatively-treated
     basal cell or squamous cell carcinoma of the skin or cervical carcinoma in situ,
     unless received curative treatment and with documented evidence of no recurrence in
     the past five years;

 15. Any mental or cognitive disorder, that would interfere the ability to understand the
     informed consent document or the operation and compliance of study;

 16. Patients are currently enrolled in another investigational drug study, or completed
     within 4 weeks prior to study entry, with the exception of patients only in overall
     survival follow-up;

 17. Any other condition which is inappropriate for the study in the opinion of the
     investigators.

Inclusion Criteria:

  -  Age >= 18 years;

  -  Resected Stage II-III Non-small Cell Lung Cancer (NSCLC) per American Joint Committee
     on Cancer staging criteria, 8th revised edition;

  -  Complete R0 resection of Stage II or III NSCLC prior to enrollment and adequate
     recovery from surgery;

  -  Pathological evaluation of mediastinal lymph nodes preoperatively or intraoperatively;

  -  ctDNA (circulating tumor DNA) identified in plasma after resection of Stage II-III
     NSCLC and prior to start of adjuvant platinum-doublet therapy, as determined by
     central testing;

  -  Treatment with at least two cycles of adjuvant platinum-doublet chemotherapy regimens
     for resected NSCLC;

  -  No unequivocal evidence of disease after surgery and adjuvant platinum-doublet
     chemotherapy, as assessed on imaging (computed tomography [CT] scan or magnetic
     resonance imaging [MRI]) within 28 days prior to randomization;

  -  Availability of adequate tumor material;

  -  Eastern Cooperative Oncology Group (ECOG) Performance Status 0 or 1;

  -  Adequate hematologic and end-organ function;

  -  Negative HIV test at screening;

  -  Negative hepatitis B test at screening;

  -  Negative hepatitis C test at screening.

Exclusion Criteria:

  -  Participants with a known mutation in exons 18-21 of epidermal growth factor receptor
     (EGFR) or with a known anaplastic lymphoma kinase (ALK) or reactive oxygen species
     (ROS) alteration;

  -  History of malignancy other than disease under study within 5 years prior to
     enrollment, with the exception of malignancies with a negligible risk of metastasis or
     death, such as adequately treated carcinoma in situ of the cervix, non-melanoma skin
     cancer, localized prostate cancer, ductal carcinoma in situ, or Stage I uterine
     cancer;

  -  Induction and neoadjuvant systemic therapy prior to resection of NSCLC;

  -  Radiotherapy prior to or after resection of NSCLC;

  -  Prior systemic investigational therapy;

  -  Prior anti-CTLA-4, anti-PD-1, and anti-PD-L1 therapeutic antibodies, or a cancer
     vaccine;

  -  Treatment with systemic immunostimulatory agents within 6 weeks or 5 drug elimination
     half-lives, prior to initiation of study treatment;

  -  Treatment with systemic immunosuppressive medication within 2 weeks prior to
     initiation of study treatment or anticipation of need for systemic immunosuppressive
     medication during study treatment;

  -  Treatment with monoamine oxidase inhibitors (MAOIs) within 3 weeks prior to initiation
     of study treatment or requirement for ongoing treatment with MAOIs;

  -  Active or history of autoimmune disease or immune deficiency;

  -  Known primary immunodeficiencies, either cellular or combined T-cell and B-cell
     immunodeficiencies;

  -  History of idiopathic pulmonary fibrosis, organizing pneumonia, drug-induced
     pneumonitis, or idiopathic pneumonitis, or evidence of active pneumonitis on screening
     chest CT scan;

  -  Significant cardiovascular disease;

  -  Major surgical procedure, other than for diagnosis or for resection of disease under
     current study, within 4 weeks prior to initiation of study treatment, or anticipation
     of need for a major surgical procedure during the study;

  -  Known active or latent tuberculosis infection;

  -  Recent acute infection;

  -  Treatment with a live, attenuated vaccine within 4 weeks prior to initiation of study
     treatment, or anticipation of need for such a vaccine during study treatment or within
     5 months after the final dose of study treatment;

  -  Prior allogeneic stem cell or solid organ transplantation;

  -  Any other disease, metabolic dysfunction, physical examination finding, or clinical
     laboratory finding that contraindicates the use of an investigational drug, may affect
     the interpretation of the results, or may render the participants at high risk from
     treatment complications;

  -  Known clinically significant liver disease;

  -  Previous splenectomy;

  -  History of severe allergic anaphylactic reactions to chimeric or humanized antibodies
     or fusion proteins;

  -  Known hypersensitivity to Chinese hamster ovary cell products or any component of the
     atezolizumab formulation;

  -  Known allergy or hypersensitivity to any component of RO7198457;

  -  Pregnant or lactating women.

Inclusion Criteria:

  1. Histologically and/or cytologically diagnosed patients with advanced, metastatic
     breast cancer,or lacking standard therapy or being failed to or recurrent after
     standard therapy;

  2. Patients who have previously treated with ≤4 chemotherapeutic regimes;

  3. Patients who have previously treated with an anthracyclin antibiotics and a taxane;

  4. Age 18 -70 years old, ECOG performance status of 0-2; Life expectancy of 3 months or
     more;

  5. Patients with at least 1 measurable target lesion determined by CT within 2 weeks
     prior to enrollment;

  6. Neuropathy <CTC2 degree （NCI CTC4.03）within 4 weeks prior to enrollment;

  7. Basically normal results from routine blood test within 1 week prior to enrollment;

  8. Basically normal liver and renal functions within 1 week prior to enrollment;

  9. No abnormal function for major internal organs, no heart diseases.

Exclusion Criteria:

  1. Received chemotherapy, radiotherapy, therapies with hormones or molecularly targeted
     drugs 4 weeks prior to enrollment, or received other chemotherapies while
     participating in this trial;

  2. Patients with documented hypersensitivity to Cremophor EL, or patients with previous
     taxane treatment related SAE;

  3. Patients of pregnancy or breast feeding;

  4. Patients with previous standard capecitabine treatment ineffective, or patients
     received standard capecitabine treatment effective, but with less than 6 months of
     capecitabine clearance period;

  5. Patients with uncontrolled brain metastasis or bone metastasis, which plan for recent
     surgery or local radiotherapy, or other emergency treatment;

  6. Patients combined with severe and /or uncontrolled medical conditions, including
     severe cardiovascular disease, uncontrolled diabetes and high blood pressure, severe
     infection, severe gastrointestinal ulceration, and patients with incontrollable
     psychiatric history;

  7. Patients with poor compliance;

  8. Patients not fitted for this study determined by the investigators.

Inclusion Criteria:

  1. Male or female aged ≥18 years

  2. Histologically proven adenocarcinoma of the colon;

  3. Completed cancer staging with CT-abdomen and CT-thorax/X-thorax according to
     hospital's standard of care;

  4. Confirmed eligibility for surgery with curative intent as deemed by the hospital's
     multidisciplinary board (MDB) review;

  5. An intratumoural gene expression profile of PDGFR-α, PDGFR-β, PDGF-C and KIT,
     indicative of the mesenchymal phenotype, according to our diagnostic RT-qPCR test
     (i.e. more than 50% chance of having the mesenchymal phenotype);

  6. Minimum of four properly stored pre-treatment biopsies for gene expression
     analysis/ELISA;

  7. WHO performance status 0 or 1;

  8. Adequate haematology status and organ function, defined as:

       -  Normal creatinine clearance (≥60 ml/min (MRDR))

       -  ALAT within 2.5x upper limit of normal (ULN)

       -  PT-INR < 1.5

       -  Leukocytes > 1,5*10^9/L; Hb > 6.0 mmol/L; platelets > 100*10^9/L

  9. Willingness and ability to comply with scheduled visits, treatment plans and
     laboratory tests;

 10. Written informed consent.

Exclusion Criteria:

  1. The presence of synchronous distant metastases;

  2. Current hospital standard of care dictates that subject should undergo any neoadjuvant
     therapy;

  3. Concurrent participation in another clinical trial using any medicinal product, or
     participation in such a trial in the period of three months prior to the current
     trial;

  4. Women who are pregnant, plan to become pregnant or are lactating during the study or
     for up to 30 days after the last dose of imatinib;

  5. Known HIV or Hepatitis B/C infection;

  6. Known symptomatic congestive heart failure;

  7. Co-morbidity requiring concomitant treatment with drugs that act as strong inducers of
     CYP3A4 or with drugs with a narrow therapeutic range influenced by imatinib

Inclusion Criteria:

  1. Age: 18-70 years;

  2. Type 2 diabetes mellitus;

  3. Not used antidiabetic drugs within 3 months;

  4. HbA1c(7-10%);

  5. Presence of fatty liver disease (hepatic fat content ≥ 20% by quantitative
